import React, {useState, useEffect} from 'react'
import './App.css';
import Nav from './Components/Nav';
import TransactionModule from './Components/Transaction_Module';
import BankComponent from './Components/BankComponent';
import {useNavigate } from 'react-router-dom';


function App() {
  const [storeJson, setStoreJson] = useState([])
  const [transactions, settransactions] = useState([])
  const [banks, setBanks] = useState([])
  const [user, setUser] = useState(null);
  const navigate = useNavigate()


  useEffect(()=> {
    fetch('/api')
    .then(r=>r.json())
    .then(data=>{
      console.log(data)
    })  
},[])
  useEffect(()=> {
    fetch('/api/transaction')
    .then(r=>r.json())
    .then(data=>{
      settransactions(data)
    })  
  },[])

  useEffect(()=> {
    fetch('/api/banks')
    .then(r=>r.json())
    .then(data=>{
      setBanks(data)
    })  
},[])

useEffect(()=> {
  fetch('/api/check_session')
  .then((r)=>{
    if(r.ok){
      r.json()
      .then(user =>{
        setUser(user)
      })
    }
    else{
      navigate('/login')
    }
    })

},[])

  return (
    <main>
    <Nav />
    <div className='home_wrapper'>
      <div className='accounts'>
        <div className='_wrapper'>
          <h2>Bank Name</h2>
          <div className='bank_id'>
            <h3 id = "bank_name"><BankComponent banks = {banks}/></h3>
          </div>
        </div>

      </div>

          <div className='transactions'>
          <div className='_wrapper'>  

            <h2 className='transaction_header'>Transactions</h2>

          <TransactionModule transactions = {transactions}/>
          </div>
        </div>
    </div>
    </main>
  )
}

export default App
